= Client side validation with LiveValidation =

It's important to have server side validation for security and because not everyone uses Javascript but client side validation while the user types can improve the user's experience and save server load from forms submitted over and over again.
To do validation on the client side you have to use the LiveValidation Javascript code. You can define your own style for validation error messages or you can use the style sheet which is used by [[XWiki.Registration>>extensions:Extension.Administration Application#HVerifiedRegistrationPage28SinceEnterprise2.2M229]].

Here is a simple example of how to use LiveValidation in XWiki:

{{code}}
{{velocity}}
$xwiki.get('jsfx').use('uicomponents/widgets/validation/livevalidation_prototype.js')
$xwiki.get('ssfx').use('uicomponents/widgets/validation/livevalidation.css')
{{/velocity}}
{{html}}
<form action="">
<label for="helloField">Say hello to LiveValidation:</label>
<input id="helloField" length="20" type="text">
</form>
<script>
/* <![CDATA[ */
document.observe('dom:loaded', function() {
var helloField = new LiveValidation("helloField", { validMessage: "Hi There.", wait: 500} );
helloField.add( Validate.Presence, { failureMessage: "Say Something, anything..."} );
helloField.add( Validate.Format, { pattern: /^[Hh]ello$/, failureMessage: "How about saying 'Hello'?"} );
});// ]]> 
</script>
{{/html}}
{{/code}}

The result is this:

{{velocity}}
$xwiki.get('jsfx').use('uicomponents/widgets/validation/livevalidation_prototype.js')
$xwiki.get('ssfx').use('uicomponents/widgets/validation/livevalidation.css')
{{/velocity}}

{{html}}

<form action="">
<label for="helloField">Say hello to LiveValidation:</label>
<input id="helloField" length="20" type="text">
</form>
<script>
/* <![CDATA[ */
document.observe('dom:loaded', function() {
var helloField = new LiveValidation("helloField", { validMessage: "Hi There.", wait: 500} );
helloField.add( Validate.Presence, { failureMessage: "Say Something, anything..."} );
helloField.add( Validate.Format, { pattern: /^[Hh]ello$/, failureMessage: "How about saying 'Hello'?"} );
});// ]]> 
</script>

{{/html}}

This example shows validation of [[presence>>http://livevalidation.com/documentation#ValidatePresence]] (something must be written) and validation of [[format>>http://livevalidation.com/documentation#ValidateFormat]] (testing against a regular expression).
Notice how the first line of Javascript says **new LiveValidation("helloField"**. This binds the validation to field with the id "helloField". Text validation also works on TextAreas.
There are more types of validation which are documented in the [[LiveValidation documentation>>http://livevalidation.com/documentation]].
To change the look and feel of the error message, you may define your own CSS [[skin extension>>platform:DevGuide.SkinExtensionsTutorial]] instead of using the one provided.
All validation messages are of the class (% class="LV_validation_message" %)##LV_validation_message##(%%). The error messages are of the class (% class="LV_invalid" %)##LV_invalid##(%%) and the valid messages are of class (% class="LV_valid" %)##LV_valid##(%%). LiveValidation will also detect submit buttons and bind to them, blocking them if fields are invalid. There are ways around this such as using prototype's [[Event.stopObserving>>http://prototypejs.org/doc/latest/dom/Event/stopObserving/]] function.
